import React from "react";
import {Button} from 'react-bootstrap';

const Main = (props) => {
    return(
        <>
            <div>
                <div className="container">
                    <div className="start">
                        <h1 className="mt-5 text-center">나와 잘 어울리는 학과 TEST! (수도권 전문대 Ver.)</h1>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Main;
